import { scrollMixins } from '@/mixins/scroll.js'
import img from '@/img/logo.png'
import {
		mapActions
	} from 'vuex';

    export default {
		mixins:[scrollMixins],
        data: () => ({
			rules: {
				required: v => !!v || '必填',
				length: v =>  (v&&v.length <= 68) || '超出长度',
				size: v => v > 0 || '必须大于0',
				isEmpty: v => /\S/.test(v) || '不可为空',
				not: v => !/[\u4E00-\u9FA5]/g.test(v) || '不能是中文'
			},
			
			codeValid:true,//激活码校验
			
			code:'',//鸡和马
			
			dialog:false,

			userData: sessionStorage.userData ? JSON.parse(sessionStorage.userData) : {},
			
			logo: img,

			links: [
			  {
			    to: '/dashboard',
			    icon: 0,
			    text: '首页'
			  },
			  {
			    to: '/list',
			    icon: 1,
			    text: '详细数据'
			  },
			  {
			    to: '/rule',
			    icon: 2,
			    text: '规则策略'
			  },
			  {
				to: '/dem',
				icon: 3,
				text:'托管数据'
			  }
			],

            title: null,
            responsive: false,
            responsiveInput: false
        }),

        watch: {
            '$route'(val) {
                this.title = val.name
            },
			dialog:{
				handler(nV,oV){
					nV&&this.afterOpen();//mixins不允许滚动
					!nV&&this.beforeClose();
				},
				immediate:true
			}

        },

        mounted() {
            this.onResponsiveInverted()
            window.addEventListener('resize', this.onResponsiveInverted)
        },
        beforeDestroy() {
            window.removeEventListener('resize', this.onResponsiveInverted)
        },

        methods: {
			...mapActions(['changeLay']),
			renew() {//显示续费对话框
				this.dialog = true;
			},
			
			cancelDialog() {
				this.code = '';
				this.dialog = false;
			},
			
			postCode() {//提交激活码
				if (this.$refs.codeForm.validate()) {
					this.changeLay(true);
					$ax.getAjaxData('/EasWebUser/recharge', {
						code: this.code
					}, (res) => {
			
						this.changeLay(false);
						if (res.code == 1) {
							let data = JSON.parse(sessionStorage.userData);
							data.endTime = res.endTime;
							sessionStorage.userData = JSON.stringify(data);
							this.userData = data;
			
							let msg = {
								state: true,
								errorText: {
									type: 'success',
									text: '续期成功！'
								}
							}
							this.changeSnack(msg);
							this.dialog = false;
							this.news = {
								A1:'',
								A2:'',
								A3:'',
								A4:0.1,
								A5:0
							},
							//
							this.code = '';
						}
			
			
					}, {
						hasToken: true
					});
				}
			},
			
			changeTime(time) {
				return this.$utils.timestampToTime(Number(time));
			},

			toRouter(name){//路由
				if(this.$route.path!==name){
					this.$router.push({ path:name});
				}

			},

            onClickBtn() {
                this.$store.state.showBar = !this.$store.state.showBar;
				console.log(this.$store.state.showBar)
            },

            onResponsiveInverted() {
                if (window.innerWidth < 991) {
                    this.responsive = true
                    this.responsiveInput = false
                } else {
                    this.responsive = false
                    this.responsiveInput = true
                }
            },
			
			exit() {
				this.$xyDialog({
					title:'退出登录',
				    content: '确定退出吗?',
				    onOk: () => {
						sessionStorage.clear();
						this.$store.state.showBar = false;
						this.$router.replace({
							path: '/login'
						});
					},
				});

			},

        }
    }
